import './App.css';
import Web3 from 'web3';
import QuarkChain from 'quarkchain-web3';
import {ABIinterface, roiABIinterface, poolROIContractAddress, poolContractAddress, fullShardKey, jrpcUrl, standardShardKeys} from './components/config';
import {PoolInterface, Navbar} from './components/poolInterface.js';
import React from 'react';
import {Route, BrowserRouter as Router} from 'react-router-dom';
import {ToastContainer} from 'react-toastify';

import 'bootstrap/dist/css/bootstrap.min.css';
import 'react-toastify/dist/ReactToastify.css'

import Home from './routes/Home'

let web3 = new Web3()


if(window.ethereum){
  web3 = new Web3(web3.givenProvider);
  QuarkChain.injectWeb3(web3, jrpcUrl);
  window.ethereum.enable();
}

function App() {

  return (
    <Router>
      <div className="App">
        <header className="App-header">
            <Navbar/>
            <ToastContainer/>
            <Route path="/" exact render={(props => <Home web3={web3}/>)}/>
            <Route path="/roicalc"/>
        </header>
      </div>
    </Router>
  );
}

export default App;
